A match block is used in much the same way as an if block, but match blocks can be used to pattern match . The match block is functionally equivalent to a rust match . {% match data %} {% when Some(value) if !value.is_empty() %} <a href="{% value.href %}">{% value.name %}</a> {% when Some(value) %} <button onclick="noValue">{% value.name %}</button> {% when None %} <span>No Data</span>
{% end %} Just like their rust counterparts Stilts matches are exhaustive, meaning that all possible cases must be covered by the match arms. If you need, you can use the wildcard catch-all to provide a "default" case. {% match data %} {% when Some() if !value.is_empty() %} <a href="{% value.href %}">{% value.name %}</a> {% when _ %}
{% end %}

