The macro block defines a section of template code that can be manually called to render in multiple locations and with different arguments. This is most useful for reducing code duplication within a template. Macros are not similar to rust macros, instead they are more like functions which can take args and will always output template code. This is a simple example where we have to do the same thing twice but with two different sets of data, and in two different locations within the template. We could write the whole for loop twice, or we could use a macro! {% macro list_users(users: &[User]) %}
<ul> {% for user in users %} <li> {% user.name %} </li> {% end %}
</ul>
{% end %} <div class="active"> {% call list_users(active_users) %}
</div>
<div class="inactive"> {% call list_users(inactive_users) %}
</div>

